import React, { useState } from "react";

class Client {
  constructor(firstName, lastName, dob, email, address, status) {
      this.firstName = firstName;
      this.lastName = lastName;
      this.dob = dob;
      this.email = email;
      this.address = address;
      this.status = status;
  }
}

class ClientManager {
  constructor() {
      this.clients = [];
  }

  addClient(firstName, lastName, dob, email, address, status) {
      const client = new Client(firstName, lastName, dob, email, address, status);
      this.clients.push(client);
  }

  updateClient(firstName, lastName, fieldsToUpdate) {
      let client = this.clients.find(client => client.firstName === firstName && client.lastName === lastName);
      if (client) {
          Object.keys(fieldsToUpdate).forEach(key => {
              if (client.hasOwnProperty(key)) {
                  client[key] = fieldsToUpdate[key];
              }
          });
      } else {
          console.log('Client not found');
      }
  }

  viewAllClients() {
      return this.clients;
  }

  filterClientsByStatus(status) {
      return this.clients.filter(client => client.status === status);
  }
}

let manager = new ClientManager();

document.getElementById('client-form').addEventListener('submit', function(event) {
  event.preventDefault();
  const firstName = document.getElementById('first-name').value;
  const lastName = document.getElementById('last-name').value;
  const dob = document.getElementById('dob').value;
  const email = document.getElementById('email').value;
  const address = document.getElementById('address').value;
  const status = document.getElementById('status').value;

  manager.addClient(firstName, lastName, dob, email, address, status);
  renderClients();
});

document.getElementById('filter-status').addEventListener('change', function() {
  renderClients();
});

export default function renderClients() {
  const filterStatus = document.getElementById('filter-status').value;
  const clients = filterStatus ? manager.filterClientsByStatus(filterStatus) : manager.viewAllClients();
  const clientListElement = document.getElementById('client-list');
  clientListElement.innerHTML = '';
  clients.forEach(client => {
      const clientElement = document.createElement('div');
      clientElement.className = 'client';
      clientElement.innerHTML = `
          <p>Name: ${client.firstName} ${client.lastName}</p>
          <p>DOB: ${client.dob}</p>
          <p>Email: ${client.email}</p>
          <p>Address: ${client.address}</p>
          <p>Status: ${client.status}</p>
      `;
      clientListElement.appendChild(clientElement);
  });


  return (
    <div>
<head>
    <title>Client Manager</title>
</head>
<body>
    <div id="app">
        <h1>Client Manager</h1>

        <h2>Add New Client</h2>
        <form id="client-form">
            <label>
                First Name:
                <input type="text" id="first-name" />
            </label>
            <label>
                Last Name:
                <input type="text" id="last-name" />
            </label>
            <label>
                DOB:
                <input type="date" id="dob" />
            </label>
            <label>
                Email:
                <input type="email" id="email" />
            </label>
            <label>
                Address:
                <input type="text" id="address" />
            </label>
            <label>
                Status:
                <select id="status">
                    <option value="New">New</option>
                    <option value="Active">Active</option>
                    <option value="Inactive">Inactive</option>
                </select>
            </label>
            <button type="submit">Add Client</button>
        </form>

        <h2>Clients</h2>
        <label>
            Filter by status:
            <select id="filter-status">
                <option value="">All</option>
                <option value="New">New</option>
                <option value="Active">Active</option>
                <option value="Inactive">Inactive</option>
            </select>
        </label>
        <div class="client-list" id="client-list"></div>
    </div>

    <script src="app.js"></script>
</body>
</div>
  )
}
